INSERT INTO `tp_notice` VALUES ('3', 'H-ui 前端框架', '&lt;p style=&quot;word-wrap: break-word; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Helvetica, tahoma, arial, &amp;quot;WenQuanYi Micro Hei&amp;quot;, Verdana, sans-serif, 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;致亲爱的H-ui用户：&lt;/p&gt;&lt;p style=&quot;word-wrap: break-word; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Helvetica, tahoma, arial, &amp;quot;WenQuanYi Micro Hei&amp;quot;, Verdana, sans-serif, 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;&quot;&gt;感谢您一年来对H-ui的支持和包容。为了更好的服务大家，在2017新年来临之际，我们全新发布了3.0版本。新版的发布离不开广大用户给出的建议和意见。3.0版本在原先2.x系列基础上做了很多的优化调整，完善了更多demo，整合了更多优秀插件；去掉了一些不是很好的插件；优化了框架的体积。&lt;/p&gt;&lt;p style=&quot;word-wrap: break-word; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Helvetica, tahoma, arial, &amp;quot;WenQuanYi Micro Hei&amp;quot;, Verdana, sans-serif, 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;&quot;&gt;H-ui是一个相对成长比较慢的前端框架，相比目前行业众多框架还有很多不足。但初心不改，实实在在把事做好，做用户最喜欢的框架。更好为中小企业服务。之前，很多用户反馈文档不全，不完整等问题，我们也一直没有时间去继续整理完善，在此说声抱歉。2017开始，我们会重新书写、完善文档，让用户使用起来更省心。&lt;/p&gt;&lt;p style=&quot;word-wrap: break-word; margin-top: 0px; margin-bottom: 10px; padding: 0px; color: rgb(51, 51, 51); font-family: &amp;quot;Microsoft Yahei&amp;quot;, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Helvetica, tahoma, arial, &amp;quot;WenQuanYi Micro Hei&amp;quot;, Verdana, sans-serif, 宋体; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em;&quot;&gt;祝大家，鸡年大吉！一路（16）有（U）你，一起（17）前行！&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', null, null, null, '0');
INSERT INTO `tp_notice` VALUES ('4', 'UEditor 介绍', '&lt;p style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; text-align: justify; text-indent: 2em; color: rgb(51, 51, 51); font-family: &amp;quot;Myriad Pro&amp;quot;, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Microsoft YaHei&amp;quot;, 微软雅黑, Calibri, Helvetica, tahoma, arial, simsun, 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;UEditor 是由百度「FEX前端研发团队」开发的所见即所得富文本web编辑器，具有轻量，可定制，注重用户体验等特点，开源基于MIT协议，允许自由使用和修改代码。&lt;/p&gt;&lt;h2 style=&quot;box-sizing: border-box; font-family: ff-tisa-web-pro-1, ff-tisa-web-pro-2, &amp;quot;Lucida Grande&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Hiragino Sans GB W3&amp;quot;, &amp;quot;Microsoft YaHei UI&amp;quot;, &amp;quot;Microsoft YaHei&amp;quot;, &amp;quot;WenQuanYi Micro Hei&amp;quot;, sans-serif; font-weight: 500; line-height: 1.1; color: rgb(51, 51, 51); margin-top: 20px; margin-bottom: 10px; font-size: 30px; padding-bottom: 9px; border-bottom: 1px solid rgb(238, 238, 238); white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;1 入门部署和体验&lt;/h2&gt;&lt;h3 style=&quot;box-sizing: border-box; font-family: ff-tisa-web-pro-1, ff-tisa-web-pro-2, &amp;quot;Lucida Grande&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Hiragino Sans GB W3&amp;quot;, &amp;quot;Microsoft YaHei UI&amp;quot;, &amp;quot;Microsoft YaHei&amp;quot;, &amp;quot;WenQuanYi Micro Hei&amp;quot;, sans-serif; font-weight: 500; line-height: 1.1; color: rgb(51, 51, 51); margin-top: 20px; margin-bottom: 10px; font-size: 24px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;1.1 下载编辑器&lt;/h3&gt;&lt;p style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; text-align: justify; text-indent: 2em; color: rgb(51, 51, 51); font-family: &amp;quot;Myriad Pro&amp;quot;, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Microsoft YaHei&amp;quot;, 微软雅黑, Calibri, Helvetica, tahoma, arial, simsun, 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;到官网下载 UEditor 最新版：&lt;a href=&quot;http://ueditor.baidu.com/website/download.html#ueditor&quot; title=&quot;官网下载地址&quot; style=&quot;box-sizing: border-box; background: transparent; color: rgb(66, 139, 202); text-decoration-line: none;&quot;&gt;[官网地址]&lt;/a&gt;&lt;/p&gt;&lt;h3 style=&quot;box-sizing: border-box; font-family: ff-tisa-web-pro-1, ff-tisa-web-pro-2, &amp;quot;Lucida Grande&amp;quot;, &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Hiragino Sans GB W3&amp;quot;, &amp;quot;Microsoft YaHei UI&amp;quot;, &amp;quot;Microsoft YaHei&amp;quot;, &amp;quot;WenQuanYi Micro Hei&amp;quot;, sans-serif; font-weight: 500; line-height: 1.1; color: rgb(51, 51, 51); margin-top: 20px; margin-bottom: 10px; font-size: 24px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;1.2 创建demo文件&lt;/h3&gt;&lt;p style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; text-align: justify; text-indent: 2em; color: rgb(51, 51, 51); font-family: &amp;quot;Myriad Pro&amp;quot;, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Microsoft YaHei&amp;quot;, 微软雅黑, Calibri, Helvetica, tahoma, arial, simsun, 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;解压下载的包，在解压后的目录创建 demo.html 文件，填入下面的html代码&lt;/p&gt;&lt;p style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; text-align: justify; text-indent: 2em; color: rgb(51, 51, 51); font-family: &amp;quot;Myriad Pro&amp;quot;, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Microsoft YaHei&amp;quot;, 微软雅黑, Calibri, Helvetica, tahoma, arial, simsun, 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; text-align: justify; text-indent: 2em; color: rgb(51, 51, 51); font-family: &amp;quot;Myriad Pro&amp;quot;, &amp;quot;Hiragino Sans GB&amp;quot;, &amp;quot;Microsoft YaHei&amp;quot;, 微软雅黑, Calibri, Helvetica, tahoma, arial, simsun, 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;92810392103921321&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', null, '1497600292', '1497600435', '0');
INSERT INTO `tp_notice` VALUES ('5', 'json解析器是什么', '&lt;p style=&quot;margin-top: 0px; margin-bottom: 15px; word-wrap: break-word; white-space: pre-wrap; color: rgb(102, 102, 102); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;编写一个JSON解析器实际上就是一个函数，它的输入是一个表示JSON的字符串，输出是结构化的对应到语言本身的数据结构。&lt;/p&gt;&lt;p style=&quot;margin-top: 15px; margin-bottom: 15px; word-wrap: break-word; white-space: pre-wrap; color: rgb(102, 102, 102); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;和XML相比，JSON本身结构非常简单，并且仅有几种数据类型，以Java为例，对应的数据结构是：&lt;/p&gt;&lt;ul style=&quot;margin-top: 15px; margin-bottom: 15px; padding-left: 30px; color: rgb(102, 102, 102); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot; class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;&amp;quot;string&amp;quot;：Java的&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;String&lt;/code&gt;；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;number：Java的&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;Long&lt;/code&gt;或&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;Double&lt;/code&gt;；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;true/false：Java的&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;Boolean&lt;/code&gt;；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;null：Java的&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;null&lt;/code&gt;；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;[array]：Java的&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;List&amp;lt;Object&amp;gt;&lt;/code&gt;或&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;Object[]&lt;/code&gt;；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;{&amp;quot;key&amp;quot;:&amp;quot;value&amp;quot;}：Java的&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;Map&amp;lt;String, Object&amp;gt;&lt;/code&gt;。&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-top: 15px; margin-bottom: 15px; word-wrap: break-word; white-space: pre-wrap; color: rgb(102, 102, 102); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;解析JSON和解析XML类似，最终都是解析为内存的一个对象。出于效率考虑，使用流的方式几乎是唯一选择，也就是解析器只从头扫描一遍JSON字符串，就完整地解析出对应的数据结构。&lt;/p&gt;&lt;p style=&quot;margin-top: 15px; margin-bottom: 15px; word-wrap: break-word; white-space: pre-wrap; color: rgb(102, 102, 102); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;本质上解析器就是一个状态机，只要按照JSON定义的格式（参考&lt;a href=&quot;http://www.json.org/&quot; target=&quot;_blank&quot; style=&quot;background: transparent; color: rgb(5, 147, 211); text-decoration-line: none; cursor: pointer;&quot;&gt;http://www.json.org&lt;/a&gt;，正确实现状态转移即可。但是为了简化代码，我们也没必要完整地实现一个字符一个字符的状态转移。&lt;/p&gt;&lt;p style=&quot;margin-top: 15px; margin-bottom: 15px; word-wrap: break-word; white-space: pre-wrap; color: rgb(102, 102, 102); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;解析器的输入应该是一个字符流，所以，第一步是获得&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;Reader&lt;/code&gt;，以便能不断地读入下一个字符。&lt;/p&gt;&lt;p style=&quot;margin-top: 15px; margin-bottom: 15px; word-wrap: break-word; white-space: pre-wrap; color: rgb(102, 102, 102); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;在解析的过程中，我们经常要根据下一个字符来决定状态跳转，此时又涉及到回退的问题，就是某些时候不能用&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;next()&lt;/code&gt;取下一个字符，而是用&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;peek()&lt;/code&gt;取下一个字符，但字符流的指针不移动。所以，&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;Reader&lt;/code&gt;接口不能满足这个需求，应当进一步封装一个&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;CharReader&lt;/code&gt;，它可以实现：&lt;/p&gt;&lt;ul style=&quot;margin-top: 15px; margin-bottom: 15px; padding-left: 30px; color: rgb(102, 102, 102); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot; class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;char next()：读取下一个字符，移动&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;Reader&lt;/code&gt;指针；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;char peek()：读取下一个字符，不移动&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;Reader&lt;/code&gt;指针；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;String next(int size)：读取指定的N个字符并移动指针；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;boolean hasMore()：判断流是否结束。&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-top: 15px; margin-bottom: 15px; word-wrap: break-word; white-space: pre-wrap; color: rgb(102, 102, 102); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;JSON解析比其他文本解析要简单的地方在于，任何JSON数据类型，只需要根据下一个字符即可确定，仔细总结可以发现，如果&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;peek()&lt;/code&gt;返回的字符是某个字符，就可以期望读取的数据类型：&lt;/p&gt;&lt;ul style=&quot;margin-top: 15px; margin-bottom: 15px; padding-left: 30px; color: rgb(102, 102, 102); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot; class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;{：期待一个JSON object；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;:：期待一个JSON object的value；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;,：期待一个JSON object的下一组key-value，或者一个JSON array的下一个元素；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;[：期待一个JSON array；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;t：期待一个true；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;f：期待一个false；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;n：期待一个null；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;&amp;quot;：期待一个string；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;0~9：期待一个number。&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-top: 15px; margin-bottom: 15px; word-wrap: break-word; white-space: pre-wrap; color: rgb(102, 102, 102); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;但是单个字符要匹配的状态太多了，需要进一步把字符流变为&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;Token&lt;/code&gt;，可以总结出如下几种&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;Token&lt;/code&gt;：&lt;/p&gt;&lt;ul style=&quot;margin-top: 15px; margin-bottom: 15px; padding-left: 30px; color: rgb(102, 102, 102); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot; class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;END_DOCUMENT：JSON文档结束；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;BEGIN_OBJECT：开始一个JSON object；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;END_OBJECT：结束一个JSON object；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;BEGIN_ARRAY：开始一个JSON array；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;END_ARRAY：结束一个JSON array；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;SEP_COLON：读取一个冒号；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;SEP_COMMA：读取一个逗号；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;STRING：一个String；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;BOOLEAN：一个true或false；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;NUMBER：一个number；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;NULL：一个null。&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-top: 15px; margin-bottom: 15px; word-wrap: break-word; white-space: pre-wrap; color: rgb(102, 102, 102); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;然后，将&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;CharReader&lt;/code&gt;进一步封装为&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;TokenReader&lt;/code&gt;，提供以下接口：&lt;/p&gt;&lt;ul style=&quot;margin-top: 15px; margin-bottom: 15px; padding-left: 30px; color: rgb(102, 102, 102); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot; class=&quot; list-paddingleft-2&quot;&gt;&lt;li&gt;&lt;p&gt;Token readNextToken()：读取下一个Token；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;boolean readBoolean()：读取一个boolean；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;Number readNumber()：读取一个number；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;String readString()：读取一个string；&lt;/p&gt;&lt;/li&gt;&lt;li&gt;&lt;p&gt;void readNull()：读取一个null。&lt;/p&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-top: 15px; margin-bottom: 15px; word-wrap: break-word; white-space: pre-wrap; color: rgb(102, 102, 102); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;由于JSON的Object和Array可以嵌套，在读取过程中，使用一个栈来存储Object和Array是必须的。每当我们读到一个&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;BEGIN_OBJECT&lt;/code&gt;时，就创建一个&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;Map&lt;/code&gt;并压栈；每当读到一个&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;BEGIN_ARRAY&lt;/code&gt;时，就创建一个&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;List&lt;/code&gt;并压栈；每当读到一个&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;END_OBJECT&lt;/code&gt;和&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;END_ARRAY&lt;/code&gt;时，就弹出栈顶元素，并根据新的栈顶元素判断是否压栈。此外，读到Object的Key也必须压栈，读到后面的Value后将Key-Value压入栈顶的Map。&lt;/p&gt;&lt;p style=&quot;margin-top: 15px; margin-bottom: 15px; word-wrap: break-word; white-space: pre-wrap; color: rgb(102, 102, 102); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;如果读到&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;END_DOCUMENT&lt;/code&gt;时，栈恰好只剩下一个元素，则读取正确，将该元素返回，读取结束。如果栈剩下不止一个元素，则JSON文档格式不正确。&lt;/p&gt;&lt;p style=&quot;margin-top: 15px; margin-bottom: 15px; word-wrap: break-word; white-space: pre-wrap; color: rgb(102, 102, 102); font-family: &amp;quot;Helvetica Neue&amp;quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);&quot;&gt;最后，&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;JsonReader&lt;/code&gt;的核心解析代码&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;parse()&lt;/code&gt;就是负责从&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;TokenReader&lt;/code&gt;中不断读取Token，根据当前状态操作，然后设定下一个Token期望的状态，如果与期望状态不符，则JSON的格式无效。起始状态被设定为&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;STATUS_EXPECT_SINGLE_VALUE | STATUS_EXPECT_BEGIN_OBJECT | STATUS_EXPECT_BEGIN_ARRAY&lt;/code&gt;，即期望读取到单个value、&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;{&lt;/code&gt;或&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;[&lt;/code&gt;。循环的退出点是读取到&lt;code style=&quot;font-size: 12px; font-family: Consolas, monospace, serif; color: rgb(221, 0, 85); white-space: nowrap; padding: 0px 4px; border: 1px solid rgb(221, 221, 221); border-radius: 3px; background: rgb(250, 250, 250);&quot;&gt;END_DOCUMENT&lt;/code&gt;时。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '1', '1497607702', '1497607702', '0');
